C++ 可以使用的第三方库来计算，一般有如下几种： PETSc 大规模并行科学计算 OpenCV 方便的计算机视觉计算库 Armadillo for linear algebra & scientific computing C++下的 Matlab 替代品 Eigen for Dense matrix and array manipulations and sparse linear algebra 强大且只需头文件 // 下面是基础的线性代数组解法
Eigen::Matrix3f A;
A << 1,1,1, 0,2,5 , 2,5,-1;
Eigen::Vector3f B;
B << 6, -4, 27;
std::cout << "Here is the matrix A:\n" << A << std::endl;
std::cout << "Here is the vector b:\n" << B << std::endl;
Eigen::Vector3f x = A.colPivHouseholderQr().solve(B);
std::cout << "The solution is:\n" << x << std::endl;
